import './Navbar.css'

export const Navbar = () => {
    return (
        <nav className="NavbarItems">
            <h1 className="navbar-logo">IOT Dashboard <i class="fa-solid fa-house-signal"></i></h1>
            <div className="menu-icon">

            </div>
            <ul>
                <li><NavLink to="/">Home</NavLink></li>
                <li><NavLink to="/about">About</NavLink></li>              
            </ul>
        </nav>
        
    )
}
